import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent {
  title = 'mfe-remote';
}
<h1 style="color: red">Angular App Module</h1>

<div class="ng-container">
  <nav>
    <ul>
      <li>
        <a routerLink="/c1">App Component 1</a>
      </li>
      <li>
        <a routerLink="/c2">App Component 2</a>
      </li>
    </ul>
  </nav>
  <router-outlet></router-outlet>
</div>
